def print_solution(data, manager, routing, assignment, dic):
    total_distance = 0
    total_load = 0
    total_vehicle = 0
    total_cost = 0
    total_time = 0
    one = 0
    two = 0
    three = 0
    more_than_three = 0
    keys = list(set(data['vehicle_capacities']))
    vehType_dict = {key: 0 for key in keys}
    for vehicle_id in range(data['num_vehicles']):
        index = routing.Start(vehicle_id)
        plan_output = 'Route for vehicle {}:\n'.format(vehicle_id)
        plan_output_MDC = 'Route for vehicle {}:\n'.format(vehicle_id)
        result.append(("Route for Vehicle: " + str(vehicle_id) + " " + "Max slot: " + str(
            data['vehicle_capacities'][vehicle_id])))
        route_distance = 0
        route_load = 0
        node = 0
        count_same = 1
        route = []
        distance_covered = 0
        t = 0
        while not routing.IsEnd(index):
            temp = []
            node_index = manager.IndexToNode(index)
            node += 1
            route_load += data['demands'][node_index]
            plan_output += ' {0} Load({1}) -> '.format(search_node(node_index, dic), route_load)
            if node_index == 0:
                plan_output_MDC += ' {0} Load({1}) -> '.format("FC", route_load)
            previous_index = index
            index = assignment.Value(routing.NextVar(index))
            # print(search_node(previous_index,dic),"--->",search_node(index,dic))
            if search_node(previous_index, dic) == search_node(index, dic) and previous_index is not None:
                count_same += 1
            elif previous_index is not None and index is not None:
                plan_output += ' {0} Load({1}) -> '.format(search_node(node_index, dic), route_load)
                temp.append(search_node(previous_index, dic))
                temp.append(count_same)
                route.append(temp)
                if search_node(previous_index, dic) is not None:
                    plan_output_MDC += ' {0} Load({1}) -> '.format(MDC[search_node(previous_index, dic)], route_load)
                count_same = 1
            route_distance += routing.GetArcCostForVehicle(
                previous_index, index, vehicle_id)
        plan_output += ' {0} Load({1})\n'.format(search_node(manager.IndexToNode(index), dic),
                                                 route_load)
        plan_output_MDC += ' {0} Load({1})\n'.format(search_node(search_node(manager.IndexToNode(index), dic), MDC),
                                                     route_load)
        plan_output += 'Cost of the route: {}Rs.\n'.format(route_distance)
        plan_output_MDC += 'Cost of the route: {}Rs.\n'.format(route_distance)
        # plan_output_MDC += 'Distance of the route: {}km.\n'.format((distance_covered/1000))

        # print(plan_output)
        print(plan_output_MDC)
        if len(route) == 2:
            one += 1
        elif len(route) == 3:
            two += 1
        elif len(route) == 4:
            three += 1
        elif len(route) > 4:
            more_than_three += 1
        if node > 1:
            vehType_dict[data['vehicle_capacities'][vehicle_id]] += 1
            total_vehicle += 1
        else:
            result.pop()
        total_cost += route_distance
        total_distance += distance_covered
        total_load += route_load
    # result.append(total_distance)
    result.append(total_vehicle)
    result.append(one)
    result.append(two)
    result.append(three)
    result.append(more_than_three)
    result.append(vehType_dict)
    print("Total cost: ", total_cost, "Rs.")
    print("Total Distance: ", total_distance / 1000, "km")
    print("Total vehicle: ", total_vehicle)
    # print(vehType_dict)
    # print(result)


def Manipulation(demand, distance):
    updated = {}
    Manipulated_Demand = []
    Manipulates_Distance = []
    # Rather than dividing into t
    divider = 28
    for i in demand:
        Manipulated_Demand.extend([divider] * int(math.floor(i / divider)))
        if i % divider != 0: # add any remaining directly
            Manipulated_Demand.append(i % divider);
        # if i == 1:
        #     Manipulated_Demand.extend([1])
        # elif i % 2 == 0:
        #     Manipulated_Demand.extend([2] * int(math.floor(i / 2)))
        # else:
        #     Manipulated_Demand.extend([2] * int(math.floor(i / 2) - 1))
        #     Manipulated_Demand.append(3)
    Manipulated_Demand.insert(0, 0)
    updated["Demand"] = Manipulated_Demand
    print(updated["Demand"])
    dict_inx = {}
    prev = 0
    for i, d in enumerate(demand):
        dict_inx.update({i + 1: (list(range(prev + 1, int(prev + 1 + math.floor(d / divider)))))})
        prev += int(math.floor(d / divider))
        if d % divider > 0:
            dict_inx[i+1].append(prev + 1)
            prev += 1
        # if d == 1:
        #     t = prev + 1
        #     dict_inx.update({i + 1: [t]})
        #     prev += 1
        # else:
        #     dict_inx.update({i + 1: (list(range(prev + 1, int(prev + 1 + math.floor(d / 2)))))})
        #     prev += int(math.floor(d / 2))
    updated["Parent_MDC"] = dict_inx
    for i in range(1, len(Manipulated_Demand)):
        temp = [0]
        row = search_node(i, dict_inx)
        for j in range(1, len(Manipulated_Demand)):
            col = search_node(j, dict_inx)
            temp.append(distance[row][col])
        Manipulates_Distance.append(temp)

    temp = [0]
    for i in range(1, len(Manipulated_Demand)):
        col = search_node(i, dict_inx)
        temp.append(distance[0][col])
    Manipulates_Distance.insert(0, temp)
    updated["Distance"] = Manipulates_Distance
    # print (updated["Distance"])
    # updated["Parent_MDC"] = dict_inx
    return updated


def search_node(val, dict_inx):
    if val == 0:
        return 0
    for node, node_list in dict_inx.items():
        if val in node_list:
            return node


def create_data_model(updated_data):
    data = {}
    data['distance_matrix'] = updated_data['Distance']
    data['num_vehicles'] = 100
    data['demands'] = updated_data["Demand"]
    data['vehicle_capacities'] = [28] * 100
    # data['vehicle_capacities'].extend([13] * 5)
    data['depot'] = 0
    # data["cost_per_demand_unit"] = 0
    data["vehicle_VarCost"] = [1] * 100
    # data['vehicle_VarCost'].extend([13] * 5)
    data['Fixed_cost'] = [0] * 100
    # data['Fixed_cost'].extend([1800] * 5)

    return data


def add_city_repeat_dimension(manager, routing, updated_data, cid):
    def underlying(from_node, to_node):
        from_node = manager.IndexToNode(from_node)
        to_node = manager.IndexToNode(to_node)

        # print("city ", cid, " from ", from_node, " to ", to_node)
        if search_node(to_node, updated_data['Parent_MDC']) == cid and search_node(from_node, updated_data[
            'Parent_MDC']) != search_node(to_node, updated_data['Parent_MDC']):
            return 1
        else:
            return 0

    print("Adding loop constraint for city ", cid)
    loop_callback_idx = routing.RegisterTransitCallback(underlying)
    routing.AddDimension(
        loop_callback_idx,
        0,
        1,
        True,
        'loop_count_city_' + str(cid) + '_vehicle_'
    )


